introduction:
DOK2의 새 싱글 &lt;Bliss&gt;

&lt;DOK2&gt;가 다가올 여름을 맞이하여 Funky 한 느낌의 신곡 &lt;Bliss&gt;를 발표한다.
알앤비 아티스트 SUMIN과 함께하여 곡의 청량함을 더 하였다.

'열락 (YllRock)' EP 앨범 [JERUSALM TOUR]

&quot;그 과정을 돌이켜 보니 여행을 다녀 온 것 같았어요.&quot;

&quot;음악을 하지 않았다면 만나지 못했을 사람들과, 경험하지 못했을 것들을 경험하면서 새로운 나 혹은 잊고 있던 나와 마주할 수 있었습니다.&quot;

&quot;그냥 그걸 곡마다 담았어요.&quot;

